/**
 * A unit test for JUnit
 *
 * @return   Description of the Return Value
 */
public static boolean testBufReadWrite()
{
    CachingQueue cq = new CachingQueue("testQueue3", 2);
    String test1 = "Test1";
    String test2 = "Test2";
    String test3 = "Test3";
    cq.insert(test1);
    cq.insert(test2);
    cq.insert(test3);
    affirm(cq.size() == 3);
    cq.remove();
    cq.remove();
    affirm(cq.size() == 1);
    return (cq.remove() == test3);
}

